package com.qhc.system.entity;import java.io.Serializable;import java.util.Date;/** *  * Function: Data transfer object. <br>  * * @author walker */public class UserRole		implements Serializable {	private static final long serialVersionUID = 2953065928294573181L;		/* UserId */	private Integer userId = null;	/* RoleId */	private Integer roleId = null;	public UserRole(){	}	public Integer getUserId() {		return this.userId;	}	public void setUserId(Integer userId) {		this.userId = userId;	}	 	public Integer getRoleId() {		return this.roleId;	}	public void setRoleId(Integer roleId) {		this.roleId = roleId;	}	 	@Override	public int hashCode() {		final int prime = 31;		int result = 1;		result = prime * result + ((userId == null) ? 0 : userId.hashCode());		result = prime * result + ((roleId == null) ? 0 : roleId.hashCode());		return result;	}	@Override	public boolean equals(Object obj) {		if (this == obj) {			return true;		}		if (obj == null) {			return false;		}		if (getClass() != obj.getClass()) {			return false;		}		final UserRole other = (UserRole) obj;		return (this.userId == null ? other.userId == null : this.userId.equals(other.userId))			&&(this.roleId == null ? other.roleId == null : this.roleId.equals(other.roleId));	}		public String toString() {	    final String tab = "  ";	    String str = "";	    str = "UserRole ( "	        + "userId = " + this.userId + tab	        + "roleId = " + this.roleId + tab	        + " )";		    return str;	}}